import Calculator from './calculator'
import './App.css'

const App = () => {

    const [total, setTotal] = useState(0);

    function handleAdd() {
      const inputValue = Number(document.getElementById("myInput").value);
      setTotal(total + inputValue);
    }

    return (
        <div className='app'>
            <Calculator/>
        </div>
    )
}

export default App
